import React from 'react';
import { Route, Routes } from 'react-router-dom';
import { Container } from 'reactstrap';
import Card from './components/Card';

function App() {
  return (
    <Container>
      <Routes>
        <Route path="/" element={<Card />} />
      </Routes>
    </Container>
  );
}

export default App;
